export default (function(a,b,c,d,e,f){return {data:{vmXKPTdDmv:{data:{id:1107,attributes:{imdbId:"tt0366450",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYmFhNmI0ZWItOTRkNS00MTk5LWE4MGUtYWEzYzUzYmUyZjM1XkEyXkFqcGdeQXVyMTMxMTY0OTQ@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"5.5\u002F10"},{Source:"Rotten Tomatoes",Value:"63%"}],item_lang:{data:{id:1770,attributes:{title:c,plot:"\"It\" is a Psammead, an ancient, ugly, and irritable sand fairy the children find one day on a secret beach at their uncle's mansion. It grants them one wish per day, lasting until sunset. But they soon learn it is very hard to think of really sensible wishes, and each one gets them into unexpected difficulties. Magic, the children find, can be as awkward as it is enticing.",slug:"five-children-and-it"}}},books:{data:[{id:6282,attributes:{title:"Five Children and it",description:"When four brothers and sisters discover a Psammead, or sand-fairy, in the gravel pit near the country house where they are staying, they have no way of knowing all the adventures its wish-granting will bring them.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=EyDCDAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Edith Nesbit","Gillian Avery","H. R. Millar"],firstBook:true,published:"1904-01-01",publisher:"Penguin",subtitle:a}},{id:6283,attributes:{title:c,description:"First published in 1902, “Five Children and It” is a children's novel by English writer and poet E. Nesbit. The story follows the five children Cyril, Anthea, Robert, Jane, and the “Lamb” and their adventures resulting from the discovery of a sand-fairy that has the ability to grant wishes. A charming tale of youth and innocence, “Five Children and It” would make for perfect bedtime reading and is not to be missed by fans and collectors of Nesbit's magical children's literature. Originally published in “Strand Magazine”, the tales were made into a full-length novel trilogy also including “The Phoenix and the Carpet” (1904)” and “The Story of the Amulet” (1906). Edith Nesbit (1858 – 1924) was a prolific writer of children's literature, publishing more than 60 such books under the name E. Nesbit. She was also a political activist and co-founded the Fabian Society, which had a significant influence on the Labour Party and British politics in general. Many vintage books such as this are becoming increasingly scarce and expensive. It is with this in mind that we are republishing this volume now in an affordable, modern, high-quality edition complete with a specially-commissioned new biography of the author.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=7N6dDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[d],firstBook:b,published:e,publisher:f,subtitle:a}},{id:6284,attributes:{title:c,description:"This book is part of the TREDITION CLASSICS series. The creators of this series are united by passion for literature and driven by the intention of making all public domain books available in printed format again - worldwide. At tredition we believe that a great book never goes out of style. Several mostly non-profit literature projects provide content to tredition. To support their good work, tredition donates a portion of the proceeds from each sold copy. As a reader of a TREDITION CLASSICS book, you support our mission to save many of the amazing works of world literature from oblivion.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=8_GWC-eQNhwC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["E. (Edith) Nesbit"],firstBook:b,published:"2012-02-07",publisher:"tredition",subtitle:a}},{id:6285,attributes:{title:"Five Children and It Illustrated",description:"Five Children and It is a children's novel by English author E. Nesbit. It was originally published in 1902 in the Strand Magazine under the general title The Psammead, or the Gifts, with a segment appearing each month from April to December. The stories were then expanded into a novel which was published the same year. It is the first volume of a trilogy that includes The Phoenix and the Carpet (1904) and The Story of the Amulet (1906). The book has never been out of print since its initial publication.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=pzxmzgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["E Nesbit"],firstBook:b,published:"2021-04-17",publisher:a,subtitle:a}},{id:6286,attributes:{title:"Five Children and It, The Phoenix and the Carpet, and The Story of the Amulet",description:"This vintage book contains E. Nesbit “Psammead” trilogy, including “Five Children and It”, “The Phoenix and the Carpet”, and “The Story of the Amulet”. The stories revolve around five children called Anthea, Cyril, Robert, Jane and the “Lamb”, whose lives are changed after the discovery a wish-granting sand fairy with whom they embark on many magical adventures. This classic children's trilogy is perfect bedtime reading material and is not to be missed by fans and collectors of Nesbit's influential literature. Edith Nesbit (1858 – 1924) was an English poet and author. She is perhaps best remembered for her children's literature, publishing more than 60 such books under the name E. Nesbit. She was also a political activist and co-founded the Fabian Society, which had a significant influence on the Labour Party and British politics in general. Other notable works by this author include: “The Prophet's Mantle” (1885), “Something Wrong” (1886), and “The Marden Mystery” (1896). Many vintage books such as this are becoming increasingly scarce and expensive. It is with this in mind that we are republishing this volume now in an affordable, modern, high-quality edition complete with a specially-commissioned new biography of the author.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=6N6dDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[d],firstBook:b,published:e,publisher:f,subtitle:"The Psammead Series - Books 1 - 3"}}]}}},meta:{}}},prerenderedAt:1680940969783}}("",null,"Five Children and It","E. Nesbit","2019-06-17","Read Books Ltd"))